 my improvement secrets for free so we can find the best players out there and work with you 1-on-1 at grandchampbootcamp.com\n \nGiven this is a YT channel, and anyone can claim anything, I’ll give you some stuff you can google to verify below.\n\n⚽Rocket League Rank/RL Tracker: https://rocketleague.tracker.network/rocket-league/profile/epic/SpookLuke/overview\n\nHow I got here…\n\n🔹12 yrs old: Started uploading minecraft videos at https://www.youtube.com/@Luke23MC\n🔹16 yrs old: Switched to uploading Fortnite videos on this channel. You can go to my uploads sort oldest to newest to see all of my old Fortnite videos\n🔹18 yrs old: Switched from Fortnite to Rocket League videos during Covid. I also began coaching players 1-on-1 on https://www.patreon.com/SpookLuke\n🔹19 yrs old: Rocket League went free to play and my channel blew up. To keep up with the demand for coaching, started the Grand Champ Roadmap --a rocket league course business\n🔹20 yrs old: Developed company and continued to scale course business. Eventually, I dropped out of school to pursue Youtube and the company full-time.  \n🔹21 yrs old: Switched from selling courses to coaching only. Released all courses for free on https://www.skool.com/gcb-free/about. Transformed GCR into GCB. Doubled coaching duration, cut price in half. Seeing results improve and students happier was worth making less money.\n🔹22 yrs old: @Virge joined as director of coaching to further improve the coaching experience and help us make more free Rocket league content that is accessible to everyone.\n\n\nToday: Coaching is how we make our money - not youtube videos or courses.\n\nTo all the people trying, failing, and hustling to make their dreams come true, we’re all in the middle of writing our own stories. Don't let other people, their opinions, or their stones bring you down. \n\nDo you,\nLuke\n\n━━━━━━━━━━━━━\n\n🎞️Edited By: Xereosi\n🎨Thumbnail By: Totema\n━━━━━━━━━━━━━\n⏱️Timestamps:\nIntro - 0:00\nGame 1 - 1:29\nGame 2 - 19:0 rk with you 1-on-1 at grandchampbootcamp.com\n \nGiven this is a YT channel, and anyone can claim anything, I’ll give you some stuff you can google to verify below.\n\n⚽Rocket League Rank/RL Tracker: https://rocketleague.tracker.network/...\n\nHow I got here…\n\n🔹12 yrs old: Started uploading minecraft videos at    / @luke23mc  \n🔹16 yrs old: Switched to uploading Fortnite videos on this channel. You can go to my uploads sort oldest to newest to see all of my old Fortnite videos\n🔹18 yrs old: Switched from Fortnite to Rocket League videos during Covid. I also began coaching players 1-on-1 on   / spookluke  \n🔹19 yrs old: Rocket League went free to play and my channel blew up. To keep up with the demand for coaching, started the Grand Champ Roadmap --a rocket league course business\n🔹20 yrs old: Developed company and continued to scale course business. Eventually, I dropped out of school to pursue Youtube and the company full-time.  \n🔹21 yrs old: Switched from selling courses to coaching only. Released all courses for free on https://www.skool.com/gcb-free/about. Transformed GCR into GCB. Doubled coaching duration, cut price in half. Seeing results improve and students happier was worth making less money.\n🔹22 yrs old: @Virge joined as director of coaching to further improve the coaching experience and help us make more free Rocket league content that is accessible to everyone.\n\n\nToday: Coaching is how we make our money - not youtube videos or courses.\n\nTo all the people trying, failing, and hustling to make their dreams come true, we’re all in the middle of writing our own stories. Don't let other people, their opinions, or their stones bring you down. \n\nDo you,\nLuke\n\n━━━━━━━━━━━━━\n\n🎞️Edited By: Xereosi\n🎨Thumbnail By: Totema\n━━━━━━━━━━━━━\n⏱️Timestamps:\nIntro - 0:00\nGame 1 - 1:29\nGame 2 - 19:03","commandRuns":[{"startIndex":19,"length":13,"onTap":{"innertubeCommand":{"clickTrackingParams":"CKgDEM2rARgBIhMI5Mb89KTkiwMVvFMSAR3WOSUTSPOwt-PYh7_hCA=="," rf series is a series where I walk you through all of my thoughts when playing lower ranks so that you have everything you need to win at your rank.\n━━━━━━━━━━━━━\n👋If you’re new to my channel, my name is Luke. I'm a peak Grand Champ 3 Rocket League coach. I’m also the founder and CEO at GrandChampBootcamp.com. It’s a coaching company.\n\nFULL DISCLOSURE \nI make content to make money - just - on a longer time horizon than most Youtubers.\n\nI don't want to take cheap brand partnerships or sell you a $50 course... although I'm sure I could make more money if I did either of those things (and there's nothing wrong with people who go that route).\n\nPersonally, I would rather give away all of my improvement secrets for free so we can find the best players out there and work with you 1-on-1 at grandchampbootcamp.com\n \nGiven this is a YT channel, and anyone can claim anything, I’ll give you some stuff you can google to verify below.\n\n⚽Rocket League Rank/RL Tracker: https://rocketleague.tracker.network/...\n\nHow I got here…\n\n🔹12 yrs old: Started uploading minecraft videos at    / @luke23mc  \n🔹16 yrs old: Switched to uploading Fortnite videos on this channel. You can go to my uploads sort oldest to newest to see all of my old Fortnite videos\n🔹18 yrs old: Switched from Fortnite to Rocket League videos during Covid. I also began coaching players 1-on-1 on   / spookluke  \n🔹19 yrs old: Rocket League went free to play and my channel blew up. To keep up with the demand for coaching, started the Grand Champ Roadmap --a rocket league course business\n🔹20 yrs old: Developed company and continued to scale course business. Eventually, I dropped out of school to pursue Youtube and the company full-time.  \n🔹21 yrs old: Switched from selling courses to coaching only. Released all courses for free on https://www.skool.com/gcb-free/about. Transformed GCR into GCB. Doubled coaching duration, cut price in half. Seeing results improve and students happier was worth making less money.\n🔹22 yrs old: @Virge joined as director of coaching to further improve the coaching experience and help us make more free Rocket league content that is accessible to everyone.\n\n\nToday: Coaching is how we make our money - not youtube videos or courses.\n\nTo all the people trying, failing, and hustling to make their dreams come true, we’re all in the middle of writing our own stories. Don't let other people, their opinions, or their stones bring you down. \n\nDo you,\nLuke\n\n━━━━━━━━━━━━━\n\n🎞️Edited By: Xereosi\n🎨Thumbnail By: Totema\n━━━━━━━━━━━━━\n⏱️Timestamps:\nIntro - 0:00\nGame 1 - 1:29\nGame 2 - 19:03","commandRuns":[{"startIndex":19,"length":13,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBwQ040EGAYiEwjkxvz0pOSLAxW8UxIBHdY5JRNI87C349iHv-EI","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbW4tSEZ3Y2ltRksxQmxBeFVKQ1Vxb1Z2UTc3Z3xBQ3Jtc0tuc29aZjF2cVE0X0RsVGdkTVFLRUU1Mks5NVpCaG1LYlhTbXRPZi03SHJiNmxzeDRHZ2p2bnNFclVIWTYzTmE0dEpZdXFJR2JSRkdLSUFyczlRUGREbzhZN3NMc1dkS1UtSjZxSWphbTRJZThvb05Edw\u0026q=https%3A%2F%2Fdiscord.gg%2FBkajYpGKCE\u0026v=CML8PYxt2HM","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbW4tSEZ3Y2ltRksxQmxBeFVKQ1Vxb1Z2UTc3Z3xBQ3Jtc0tuc29aZjF2cVE0X0RsVGdkTVFLRUU1Mks5NVpCaG1LYlhTbXRPZi03SHJiNmxzeDRHZ2p2bnNFclVIWTYzTmE0dEpZdXFJR2JSRkdLSUFyczlRUGREbzhZN3NMc1dkS1UtSjZxSWphbTRJZThvb05Edw\u0026q=https%3A%2F%2Fdiscord.gg%2FBkajYpGKCE\u0026v=CML8PYxt2HM","target":"TARGET_NEW_WINDOW","nofollow":true}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"Discord Channel Link: discord"}}},{"startIndex":1046,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBwQ040EGAYiEwjkxvz0pOSLAxW8UxIBHdY5JRNI87C349iHv-EI","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUh
